import React, { useEffect } from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { Provider } from 'react-redux';
import store from './redux/store';
import LandingPage from './components/LandingPage';
import HomePage from './components/HomePage';
import SearchBar from './components/SearchBar';
import './App.css';
import axios from 'axios';

import { getDogs, getTemperaments } from './redux/actions/actions';

function App() {
  useEffect(() => {
    async function fetchData() {
      try {
        const dogsResponse = await axios.get('https://api.thedogapi.com/v1/breeds');
        const dogs = dogsResponse.data;
        const temperamentsResponse = await axios.get('https://api.thedogapi.com/v1/breeds');
        const temperaments = temperamentsResponse.data.map((t) => t.name);
        store.dispatch(getDogs(dogs));
        store.dispatch(getTemperaments(temperaments));
      } catch (error) {
        console.log(error);
      }
    }

  }, []);

  return (
    <Provider store={store}>
      <div className="App">
        <Router>
          <Switch>
            <Route exact path="/" component={LandingPage} />
            <Route exact path="/home" component={HomePage} />
          </Switch>
        </Router>
      </div>
    </Provider>
  );
}

export default App;
